import React from "react";
import "./Main.css";

const Main = props => (
  <div className="cardPic">

    <div className="img-container z-depth-3">
      <img alt={props.name} src={props.image} value={props.id} />
    </div>

    <span>onClick={() => props.handleClick(props.id)}</span>
  </div>
);


export default Main;
